const Style = {
    body: {
        backgroundColor: 'black',
        color: "white",
        fontSize: 50,
        height: "100%"
    },
    bodyCard: {
        backgroundColor: 'a#FF6347',
        color: "#000",
        fontSize: 50,
        height: "100"
    },
    position: {
        justifyContent: 'center',
        alignItems: 'center'
    },
    space: {
        paddingTop: 50,
        justifyContent: 'center',
        alignItems: 'center',
        fontWeight: '800'
    },
    cardProducts: {
        borderWidth: 3,
        borderColor: "#FF0000",
        borderRadius: 6,
        padding: 15,
        margin: 10,
        justifyContent: 'center',
        alignItems: 'center',
    },
    text: {
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        fontSize: 22,
        paddingTop: 150
    }
}

export default Style
